import { useEffect, useState } from "react"
import { velocity, handleData } from "../../interfaces/interface"
import { UserVelocity } from "../Bar"



export function Velocity() {
    const v: velocity = {
        id: 0,
        velocity: 0,
        capacity: 0
      }

    const [data, setData] = useState<velocity[]>([v])
    const [vel, setVel] = useState<boolean>(true)
    const [historic, setHistoric] = useState<boolean>(true)
    const [breakdown, setBreakdown] = useState<boolean>(true)


    function handleVelocity() {
        fetch('http://127.0.0.1:8000/velocity/users', {
        method: 'GET',
        headers: {
            accept: 'application/json',
        },
        }).then(resp => resp.json()).then(json => setData(json.filter((d: { velocity: number, capacity: number, id: string }) => {
        return d.capacity > 0
        })));
        setHistoric(true);
        setBreakdown(true);
        setVel(false);
  }

    useEffect(() => {
        handleVelocity()   
        }, [])

    return (
        <UserVelocity
        id={data.map(d => d.id)}
        velocity={data.map(d => d.velocity)}
        capacity={data.map(d => d.capacity)}
      />
    )

}
